import { ErrorMessage, FastField } from "formik";
import React from "react";
import { useState } from "react";

export const Inputs = (props) => {
  const { type, name, placeholder, iconStyle, inputStyle, errMsg } = props;

  const [inputStack, setInputStack] = useState('test-');

  return (
    (
      <>
      
      <div className=" col-12">
        <div>
          <label className=""></label>
          <FastField
            type={type}
            name={name}
            placeholder={placeholder}
            className={`${iconStyle} input-group-text rounded-pill shadow-lg ${inputStyle} w-100`}
            onChange={(e) => {
              console.log(e.target.value);
              setInputStack(e.target.value);
            }}
            value={inputStack}
          />
        </div>

        <div className={`${errMsg}`}>
          <ErrorMessage
            name={name}
            render={(d) => <small className="smallFont">{d}</small>}
          />
        </div>
      </div>
      eeeeeeeeeeee
      </>
    ),
    [inputStack]
  );
};
